import React from 'react'

function UploadData(props) {
    return (props.dataTrigger)?(
        <div className='popup'>
            <div className='popup-inner'>
                <b>UPLOAD DATA</b>
                <br/>
            </div>
        </div>
            
    ):"";
}

export default UploadData
